#include <pybind11/chrono.h>
#include <pybind11/pybind11.h>
#include <pybind11/stl.h>

#include <gnuradio/dictionary_logger_backend.h>
#include <dictionary_logger_backend_pydoc.h>
#include <memory>


namespace py = pybind11;
void bind_dictionary_logger_backend(py::module& m)
{

    using dictionary_logger_backend = gr::dictionary_logger_backend;

    py::class_<spdlog::sinks::sink, std::shared_ptr<spdlog::sinks::sink>>(m, "sink");

    py::class_<dictionary_logger_backend,
               spdlog::sinks::sink,
               std::shared_ptr<dictionary_logger_backend>>(
        m, "dictionary_logger_backend", D(dictionary_logger_backend))

        .def(py::init(), D(dictionary_logger_backend, dictionary_logger_backend))
        .def(py::init<std::regex>(),
             D(dictionary_logger_backend, dictionary_logger_backend))

        .def("get_map",
             &dictionary_logger_backend::get_map,
             D(dictionary_logger_backend, get_map))

        ;
}
